import React, { useEffect, useState } from "react";
import axios from "axios";
function DashBoard() {
  useEffect = async () => {
    try {
      await axios.get(`//localhost:5000/api/room/getallrooms`).then((res) => {
        console.log(res.data);
      });
    } catch (err) {
      console.log(err);
    }
  };

  return (
    <div>
      <h1>Roooms</h1>
    </div>
  );
}

export default DashBoard;
